'''
Link : https://leetcode.com/problems/x-of-a-kind-in-a-deck-of-cards/

In a deck of cards, each card has an integer written on it.
Return true if and only if you can choose X >= 2 such that it is possible to split the entire deck into 1 or more groups of cards, where:
Each group has exactly X cards.
All the cards in each group have the same integer.

video : https://www.youtube.com/watch?v=wN_BIEB73Jc
'''



def gcd(a,b):     
    if (b == 0):
         return a
    return gcd(b, a%b)
class Solution:
    def hasGroupsSizeX(self, deck):               
        d = {}
        for i in deck: 
            d[i]=d.get(i,0)+1
        
        lowest=None
        secondlowest=None
        for x in d:
            if d[x] == 1:
                return False
            else:
                if lowest ==None and secondlowest == None:
                    lowest = d[x]
                    secondlowest = d[x]
                elif lowest > d[x]:
                    lowest = d[x]
                elif lowest < d[x] and ( secondlowest > d[x] or secondlowest == lowest) :
                    secondlowest = d[x]
        
        commonDevider = gcd(lowest,secondlowest)

        if commonDevider == 1:
            return False
        
        for x in d:
            if d[x]%commonDevider != 0:
                return False
        return True
        

deck = [1]
print(Solution().hasGroupsSizeX(deck))

